  \"NRDA-processed CTD data from the OCEAN VERITAS in the Gulf of Mexico, Cruise 4
  Leg 1, collected from 2010-06-14 to 2010-06-16, associated with the Deepwater Horizon
  Oil Spill event (NCEI Accession 0128170)\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  2,\n\t\t\"recent\": 0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-02-26T22:17:43.838308\",\n\t\"name\": \"nrda-processed-ctd-data-from-the-ocean-veritas-in-the-gulf-of-mexico-cruise-4-leg-1-collec\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Conductivity Temperature and Depth (CTD)
  measurements were collected aboard the R/V Ocean Veritas 04 to determine physical
  oceanographic parameters of the water column, and in some cases used to help guide
  sample collection as part of the Deepwater Horizon oil spill sampling effort. Temperature,
  conductivity/salinity, depth, dissolved oxygen, and fluorometry data were collected
  onboard the R/V Ocean Veritas 04. The final product is a series of NetCDF files
  containing every CTD cast that has been processed and quality checked.\",\n\t\"license_title\":
